			"first_name" : "Mark",
			"last_name" : "Manders",
			"country" : "NL",
			"bio" : "Mark Manders is a Dutch artist. He was born in 1968 in Volkel, Netherlands. Manders's body of work consists mainly of installations, drawings, sculptures and short films. Typical of his work is the arrangement of random objects, such as tables, chairs, light bulbs, blankets and dead animals. He is best known for his rough-hewn clay sculptures. *(Wikipedia)*",
