			"title" : "The Goldweigher's Field",
			"code" : "1017343",
			"body" : "**AUDIO:** Hear directly from exhibition curator Linda Batis about this work.\r\n\r\n**Date:** 1651\r\n**Materials:** etching and drypoint\r\n**Dimensions:** H: 4 13/16 in. x W: 12 9/16 in. (12.22 x 31.91 cm)\r\n**Credit:** Bequest of Charles J. Rosenbloom, 74.7.188",
