			"title" : "Effluves de Jasmin",
			"code" : "1703",
			"body" : "**Date:** 2013\r\n**Materials:** Steel road plate and silk; 1,225 lbs.\r\n**Dimensions:** 60 x 72 x 1 in. (152.4 x 182.9 x 2.5 cm)\r\n**Credit:** Courtesy of the artist and Galleria Franco Noero, Turin\r\n\r\nLara Favaretto’s sculptural works often intimate a threat of destructive actions. Favaretto also undermines structures associated with building and constructive energy by exaggerating and overstepping the authority and rationality of geometry. \r\n\r\nIn this gallery, she has positioned steel road plates (the kind used during construction projects) on the floor, crushing delicate silk fabric visible through holes at the edges. \r\n\r\nThe slabs share the formal simplicity of Minimalist artist Carl Andre’s metal floor pieces, but their more obvious practical function imbues them with a sense of transgression, or even menace (hinting at a hole in the gallery floor). Favaretto forces an awkward reckoning between the building blocks of industry, engineering, and social order and the charged energy of spectacle.\r\n\r\nFour confetti cubes by Favaretto are on view in the Heinz Galleries. ",
