			"title" : "Foot of Mountain Range Near Madrid Spain",
			"code" : "2001",
			"body" : "**Date:** c. 1963–64\r\n**Materials:** Watercolor and ballpoint pen on brown kraft paper, shellacked\r\n**Dimensions:** 19 x 24 in. (48.3 x 61 cm)\r\n**Credit:** Courtesy of Karen Lennox Gallery, Chicago",
