			"title" : "The Three Trees",
			"code" : "1017317",
			"body" : "**Date:** 1643\r\n**Materials:** etching, drypoint, and burin\r\n**Dimensions:** H: 8 5/16 in. x W: 11 in. (21.11 x 27.94 cm)\r\n**Credit:** Bequest of Charles J. Rosenbloom, 74.7.164\r\n\r\n-----\r\n\r\n**MUSICIAN'S CHOICE:** Hear original music by Matt Aelmore inspired by this print.\r\n\r\n**Composition Notes from Matt Aelmore:** *The Three Trees* is one of Rembrandt’s largest and most detailed etched landscapes. In it, a fisherman angles by the pond as an artist paints on the hill. The trees leaves grow upward like cumulus clouds anchored to the earth. But there is something curious about the shapes in the sky. Rembrandt cut ominously dark straight lines to the left, and swirling masses on the right. Hazy figurations trail off into the horizon. Something unreal is in the air forming these clouds. Whatever is happening above, it is the same air that the fisherman and artist breathe as they continue unfettered. My composition, *Gallery Cloud*, puts air into motion–sound. Like the air around the clouds in the etching, the guitars present new figuration from a few different strokes. A recording made while walking throughout the museum orients you to the space you are in at this moment like the air that the artist and fisherman breathe. Between the guitars and the recording, a new cloud emerges, with Rembrandt’s *Three Trees* as the focal point in front of you. \r\n\r\n**Musician Bio:** Born four years before the Summer of Mercy, and 29 years after the founding of Pizza Hut, Matt Aelmore is inspired by radical cultural landscape of Wichita, Kansas, where he was raised. His music is like dreaming, exploring degrees of communication and miscommunication between artist and audience, often fudging the common boundaries between music and language, and engaged by a beautifully unpredictable kind of repetition. Aelmore studied music at Wichita State University (BM), Manhattan School of Music (MM), and is currently completing his doctoral studies in music theory and composition at the University of Pittsburgh. Compositions of his have been performed throughout the United States and Europe in venues such as Chambers Fine Art, Cornelia Street Café, and The Tank in New York, the Ton-Art Festival in Esslingen, and Future Tenant in Pittsburgh. His new opera **Cowboy Rock’n’Roll USA** will be premiered Noise-Bridge Duo in Stuttgart this June.",
