			"title" : "Just What Is It that Makes Today’s Homes So Different, So Appealing?",
			"code" : "3101",
			"body" : "**Date:** 2010–11\r\n**Materials:** Video; color, silent\r\n**Length:** 4:23 min.\r\n**Credit:** Courtesy of Gallery Isabelle van den Eynde, Dubai, and the artist\r\n\r\nIn *Just What Is It that Makes Today’s Homes So Different, So Appealing?* (2010–11), Haerizadeh transforms media imagery of protest, disaster, and violence from the 2009 Iranian demonstrations into fairy tales of sensual delights, where human heads of protestors and newscasters alike are replaced with those of animals. Depicted is the shooting of a young college woman named Neda Agha-Soltan, a bystander who became the face of innocent resistance when her death was captured on camera and broadcast around the world.",
