			"title" : "Venetian Interior",
			"code" : "1004608",
			"body" : "Director Lynn Zelevansky describes John Singer Sargent's *Venetian Interior*.\r\n\r\n**Date:** 1880‑1882\r\n**Materials:** oil on canvas\r\n**Dimensions:** H: 26 7/8 in. x W: 34 3/16 in. (68.26 x 86.84 cm) \r\n**Credit:** Purchase, 20.7",
			"share_url" : "http://www.cmoa.org/CollectionDetail.aspx?item=1004608",
			"exhibition_uuid" : "6fe2d8f2-8aae-11e3-84b5-12313d0410b8",
			"location_uuid" : "d59d2510-ff7d-11e2-8645-22000aea0ef7",
