			"title" : "Reign of Winter",
			"code" : "3106",
			"body" : "**Date:** 2012–13\r\n**Materials:** Video; color, silent\r\n**Length:** 6 min.\r\n**Credit:** Courtesy of Gallery Isabelle van den Eynde, Dubai, and the artist\r\n\r\nA more recent animation, *Reign of Winter*, debuting at the *2013 Carnegie International*, takes on the subject of the British royal wedding of Prince William and Kate Middleton. Both videos, on view here, are surrounded by a selection of drawings, like torn pages from an ongoing visual manuscript or diary of contemporary life. Interrogating the voyeuristic role of the spectator and his or her ethical stance as a passive consumer of media, Haerizadeh’s drawings and animations transform found material into timeless parables, taking images out of context and turning conventional moral codes on end. ",
