			"title" : "Exhibition-Action, Group of Six Artists, Strolling through Zagreb",
			"code" : "3404",
			"body" : "**Date:** 1976\r\n**Materials:** Color inkjet print\r\n**Dimensions:** 11 13⁄16 x 8 1⁄4 in. (30 x 21 cm)\r\n**Credit:** Collection of the artist\r\n\r\nIn 1975, Stilinović visited the Belgrade Student Cultural Center’s annual arts event April Meetings, heavily influenced that year by Fluxus and Conceptual art. Upon his return to Zagreb, he formed the Grupa Sestorice Autora (Group of Six Artists) along with his brother Sven Stilinović, Boris Demur, Željko Jerman, Vlado Martek, and Fedor Vučemilović. This group pioneered what would become known as “exhibition-actions”: projecting films and slides onto the sides of buildings and displaying in-progress artworks in unexpected places, such as on city streets and on the banks of the Sava River. These spontaneous happenings consciously subverted the dominant cultural-politic by insisting on transparent process and public discourse.",
			"share_url" : "http://ci13.cmoa.org/artwork/3404",
			"exhibition_uuid" : "9b8f858e-f94c-11e2-a924-12313d01d9cd",
