			"deleted_at" : null,
			"title" : "Bag–People",
			"code" : "3419",
			"body" : "**Date:** 2001\r\n**Materials:** 80 pieces; black-and-white photographs on table\r\n**Dimensions:** 11 13⁄16 x 9 7⁄16 in. (30 x 24 cm) each\r\n**Credit:** Collection of the artist\r\n\r\nStilinović’s *Bag—People* is representative of his interest in photographing his environment, seeking out visual patterns and conceptual meaning in otherwise unremarkable everyday sights and occurrences. Here we see people on their way to work, lunches packed in ubiquitous plastic bags; the presence of the bags becomes a formal gesture, emblematic of whole global systems of consumption, waste, and labor. There is a dark, playful wisdom to the figures’ daily march in two rows down the narrow table.",
			"share_url" : "http://ci13.cmoa.org/artwork/3419",
			"exhibition_uuid" : "9b8f858e-f94c-11e2-a924-12313d01d9cd",
