			"title" : "Prince of Swords",
			"code" : "2726",
			"body" : "**Date:** 2013\r\n**Materials:** Plaster, graphite, and quartz\r\n**Dimensions:** 77 x 46 x 27 in. (195.6 x 116.8 x 68.6 cm)\r\n**Credit:** Courtesy of the artist and Koenig \u0026 Clinton, New York Produced in conversation with Sam Greenleaf Miller",
