			"title" : "A Love Story",
			"code" : "2502",
			"body" : "**Date:** 2010\r\n**Materials:** HD video installation; color, sound\r\n**Length:** 5:37 min.\r\n**Credit:** Courtesy of Marian Goodman Gallery, New York and Paris. Presentation supported by the Asian Cultural Council and George Foundation\r\n\r\nDescribed by Kanwar as the “companion, the prelude, and the postscript to *The Scene of Crime*,” *A Love Story* explores the formal elements of time, narrative, and sequence as well as themes of human isolation and connection amid an epically filmed study of a monumental garbage dump on the outskirts of New Delhi.",
