			"title" : "Utopia",
			"code" : "337",
			"body" : "Director Lynn Zelevansky describes *Utopia* by Rachel Harrison.\r\n\r\n**Date:** 2002\r\n**Materials:** Wood, polystyrene, cement, acrylic, porcelain figurine, and pyrite\r\n**Dimensions:** H: 80 in. x W: 40 in. x D: 38 1/2 in. (203.20 x 101.60 x 97.79 cm) \r\n**Credit:** Oxford Development Fund, 2002.37",
