			"title" : "A Vivarium for George E. Ohr",
			"code" : "2103",
			"body" : "**Date:** 2013\r\n**Materials:** Installation including 30 ceramics from the collection of Carolyn and Gene Hecht and 1 ceramic from the collection of Carnegie Museum of Art\r\n**Credit:** Courtesy of the artist. Presentation supported by Etant donnés: The French-American Fund for Contemporary Art.\r\n\r\nOccupying a large diorama case in the Heinz Galleries, *A Vivarium* includes 31 ceramic objects by the famous “mad potter of Biloxi,” George E. Ohr (1857–1918). Hovering around the vitrine like animals or actors in a ghost town, they literally lay out the moment when pottery became art and eccentric self-promotion became a new business model.",
