			"title" : "CMOA's Francia painting overlaid with the outline of the National Gallery's Francia painting on mylar.",
			"code" : "3622",
			"body" : "Conservator Ellen Baxter recalls her observations during the test overlaying the outline of the National Gallery's Francia painting on the CMOA Francia painting.",
			"share_url" : "",
			"exhibition_uuid" : "bcb35c9e-ecb8-11e3-9b03-12313d0410b8",
			"location_uuid" : "4a95e28a-ff7e-11e2-8f9c-22000aea0ef7",
