			"title" : "Soft Rocks, Cut Muenster: A Monument to the Six Hour Brunch",
			"code" : "3704",
			"body" : "AUDIO: Hear directly from artist Corey Escoto about his work.\r\n\r\n----------\r\n\r\n**Date:** 2014\r\n**Materials:** Styrofoam, digitally printed silk, map pins, photographs, plexiglass, plywood, formica and paint\r\n**Dimensions:** 72 x 22.25 x 20.75 in.\r\n**Credit:** Courtesy of the artist\r\n",
			"share_url" : "",
			"exhibition_uuid" : "70bcbbec-0607-11e4-b281-12313d0410b8",
