			"title" : "Several Drawings on Top of Each Other",
			"code" : "341",
			"body" : "**Staff Favorite:** Laurel Mitchell, Manager of Rights, Reproductions \u0026 Photographic Services, Carnegie Museum of Art\r\n\r\n**Date:** 1990-2002\r\n**Materials:** graphite, paper, bronze\r\n**Dimensions:** H: 8 1/4 in. x W: 11 11/16 in. (20.95 x 29.69 cm)\r\n**Credit:** Purchase: gift of The Buddy Taub Foundation, Jill and Dennis Roach, Directors",
