			"title" : "The Garden in the Rue Cortot, Montmartre",
			"code" : "1011959",
			"body" : "Associate Curator of Fine Art Amanda Zehnder describes *The Garden in the Rue Cortot, Montmartre*.\r\n\r\n**Date:** 1876\r\n**Medium:** oil on canvas\r\n**Dimensions:** H: 60 3/4 x W: 35 in. (154.31 x 88.9 cm)\r\n**Credit:** Acquired through the generosity of Mrs. Alan M. Scaife, 65.35",
