			"body" : "Associate Curator of Fine Art Amanda Zehnder describes *View of Saint-Mammès*.\r\n\r\n**Date:** c. 1881\r\n**Materials:** oil on canvas\r\n**Dimensions:** H: 21 1/2 x W: 29 in. (54.61 x 73.7 cm)\r\n**Credit:** Purchase, 99.7",
