			"title" : "What Makes Me Understand What I Know?",
			"code" : "0603",
			"body" : "**Date:** 2013\r\n**Materials:** Neon and LED lights and photographs\r\n**Dimensions:** Variable\r\n**Credit:** Courtesy of DSL Collection\r\n\r\nIn He An's ongoing project, *What Makes Me Understand What I Know?*, begun in 2009, two names are repeated over and over, spelled out in different configurations by combining fragments of disparate signs. One name, that of the artist’s father, He Taoyuan, consists of three characters; the other, Miho Yoshioka, the name of a favorite Japanese adult-video actress, is four characters long. \r\n\r\n*What Makes Me Understand What I Know?* abruptly combines references to the artist’s familial relationship with his father and his anonymous yet intimate relationship with the actress; the alienating urban spaces under hyperdevelopment in China; and memories of home from the artist’s new, adopted city of Beijing. The lighted signs evoke both the bustling thoroughfares and abandoned alleyways of contemporary megalopolises, further elucidated through projected images capturing the theft of the letters themselves. Assembled through a rebellious act of self-declaration, the works manifest the artist’s will to mark existence in this destabilizing and quickly shifting urban environment. \r\n\r\nAnother set of signs from the series is on view in the hallway adjacent to the CMA Theater.",
			"share_url" : "http://ci13.cmoa.org/artwork/0603",
