			"deleted_at" : null,
			"title" : "Untitled",
			"code" : "0905",
			"body" : "**Date:** 2013\r\n**Materials:** 4 panels; Epson UltraChrome inkjet on linen\r\n**Dimensions:** 192 x 69 in. (487.6 x 175.2 cm) each\r\n**Credit:** Courtesy of the artist and Petzel Gallery, New York\r\n\r\nFor the *2013 Carnegie International*, Wade Guyton has installed a towering, four-panel work in the sumptuous, Gilded Age Founder’s Room, interrupting the space’s stately opulence. Another installation of four new works is in the museum’s former coatroom, off of the main lobby. \r\n\r\nThis work is on view daily in the Founder's Room 4–5 p.m. (except on Saturdays, 11–noon).",
