			"deleted_at" : null,
			"title" : "Untitled",
			"code" : "0904",
			"body" : "**Date:** 2013\r\n**Materials:** Epson UltraChrome K3 inkjet on linen\r\n**Dimensions:** 128 x 108 x 2 in. (325 x 275 x 5 cm)\r\n**Credit:** Courtesy of the artist and Petzel Gallery, New York\r\n\r\nFor the *2013 Carnegie International*, Wade Guyton has transformed the museum’s main coatroom.  His installation of four new works along with leather couches from his studio creates appealing if unlikely lounge area, a space to sit, linger, look, and think. \r\n\r\nAnother work by Guyton is installed in the stately Founder’s Room, off of the museum’s Carriage Drive Entry. ",
