			"title" : "Woman VI",
			"code" : "1009422",
			"body" : "Director Lynn Zelevansky describes *Woman VI* by Willem de Kooning.\r\n\r\n**Date:** 1953\r\n**Medium:** oil on canvas\r\n**Dimensions:** H: 68 1/2 x W: 58 1/2 in. (173.99 x 148.59 cm)\r\n**Credit:** Gift of G. David Thompson, 55.24.4",
