			"code" : "1009147",
			"body" : "Associate Curator of Fine Arts Amanda Zehnder describes *The Sea at Le Havre*.\r\n\r\n**Date:** 1868\r\n**Medium:** oil on canvas\r\n**Dimensions:** H: 23 5/8 x W: 32 1/8 in. (60.01 x 81.6 cm)\r\n**Credit:** Purchase, 53.22",
