			"title" : "The Judgment of Paris",
			"code" : "1000967",
			"body" : "**AUDIO:** Hear directly from curatorial assistant Akemi May about this work.\r\n\r\n**Date:** c. 1517–1520\r\n**Materials:** engraving\r\n**Dimensions:** H: 11 5/8 x W: 17 1/8 in. (29.53 x 43.5 cm)\r\n**Credit:** Purchase, 15.11\r\n",
			"share_url" : "http://www.cmoa.org/CollectionDetail.aspx?item=1000967",
			"exhibition_uuid" : "ad73c9fa-e5a4-11e3-bb7c-12313d0410b8",
			"location_uuid" : "4014bb74-ff7e-11e2-94a5-22000aea0ef7",
