			"title" : "The Drawbridge",
			"code" : "1008300",
			"body" : "**Date:** 1761\r\n**Materials:** etching, engraving, and scratching \r\n**Dimensions:** H: 27 1/8 in. x W: 21 in. (68.90 x 53.34 cm) \r\n**Credit:** Gift of Kenneth Seaver, 48.22.7\r\n\r\n**MUSICIAN'S CHOICE:** Hear original music by Roger Zahab inspired by this print.\r\n\r\n**Composition Notes from Roger Zahab:** Here the music is set between the staves and the instruments to form a series of vertical harmonies and connecting lines. The starkness of the material is connected in my mind with Piranesi’s need to create these *Imaginary Prisons*.\r\n\r\n**Musician Bio:** Roger Zahab instigates complex relations through his activities as composer, violinist, conductor, teacher, and writer. His work has been performed throughout North and South America, Europe, and Asia by such soloists and ensembles as cellist David Russell; violinist Nathalie Shaw; flutist Lindsey Goodman; pianists Robert Frankenberry, Eric Moe, and Bennett Lerner; The Furious Band; California EAR Unit; IonSound Project and Pittsburgh New Music Ensemble; The New Amsterdam Symphony Orchestra; and the Akron Symphony Orchestra. Recordings as violinist, composer, and conductor—most recently, entelechron:  time + memory—are available on many labels and through iTunes and Spotify. Performances in the summer of 2014 include the opera *Happy Hour!* commissioned by the Opera Theater of Pittsburgh for performances in taverns throughout the Pittsburgh area in June and July as well as on their Summerfest series on July 26, and a chamber music-drama version for small spaces of Charles Dickens’s *A Christmas Carol*. Zahab currently teaches at the University of Pittsburgh, where he is senior lecturer and directs the University Symphony Orchestra and Music on the Edge Chamber Orchestra among many other things, and Vermont College of Fine Arts, where he is a founding core faculty member of the MFA in music composition. More info: www.rogerzahab.net",
